import React, { useState, useEffect, CSSProperties } from "react";
import { Streamlit, StreamlitComponentBase, withStreamlitConnection } from "streamlit-component-lib";

// Define type for menu configuration
interface MenuConfig { 
  menu_titles: string[];
  menu_titles_font_size: string;
  sub_menus: Record<string, string[]>;
  use_container_width?: boolean;
  sub_menu_color?: string; 
  sub_menu_font_size?: string;
  sub_menu_button_gap?: number;
  sub_menu_font_color?: string;
  sub_menu_imgs?: Record<string, string[]>;
  sub_menu_icons?: Record<string, string[]>;
}

// **CSS Styles**
const componentStyle: CSSProperties = {
  display: "flex",
  flexDirection: "row",
  width: '100%',
  fontFamily: 'sans-serif' 
};

const titleContainerStyle: CSSProperties = {
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  textAlign: 'center',
  flex: 1, 
  margin: '0 5px'
};

const titleStyle: CSSProperties = {
  marginBottom: '5px',
  fontWeight: 'bold'
};

const lineStyle: CSSProperties = {
  height: '1.25px',
  backgroundColor: '#BDBFC3',
  width: '100%',
};

const buttonStyle: CSSProperties = {
  cursor: "pointer",
  width: "100%",
  borderRadius: '8px',
  color: '#31333F', 
  border: "none",
  padding: '5px 5px',
};

class MultiMenu extends StreamlitComponentBase<MenuConfig> {
  private fontLoaded: boolean = false;

  componentDidMount() {
    this.loadGoogleIcons();
  }

  componentWillUnmount() {
    this.removeGoogleIcons();
  }

  loadGoogleIcons() {
    const link = document.createElement('link');
    link.href = 'https://fonts.googleapis.com/icon?family=Material+Icons';
    link.rel = 'stylesheet';
    link.onload = () => this.fontLoaded = true;
    link.onerror = () => console.error('Error loading Material Icons'); // Error handling
    document.head.appendChild(link);
  }

  removeGoogleIcons() {
    // Find the Material Icons link and remove it
    const links = document.head.querySelectorAll('link[rel="stylesheet"]');
    for (const link of links) {
      if (link.href.includes('fonts.googleapis.com/icon?family=Material+Icons')) {
        document.head.removeChild(link);
        break;
      }
    }
  }

  render = () => {
    const {
      menu_titles,
      menu_titles_font_size,
      sub_menus,
      use_container_width,
      sub_menu_color = '#F0F2F6',
      sub_menu_font_size,
      sub_menu_button_gap = 10,
      sub_menu_font_color = '#31333F',
      sub_menu_icons,
    } = this.props.args;

    const darkerSubMenuColor = darkenColor(sub_menu_color, 10);

    const componentStyle: React.CSSProperties = {
      display: "flex",
      flexDirection: "row",
      width: '100%',

     // Apply sans-serif font to the entire component
    };

    const titleContainerStyle: React.CSSProperties = {
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      textAlign: 'center',
      flex: use_container_width ? 1 : undefined,
      margin: '0 5px',

    };

    const titleStyle: React.CSSProperties = {
      marginBottom: '5px',
      fontWeight: 'bold',
      fontSize: menu_titles_font_size
    };

    const lineStyle: React.CSSProperties = {
      height: '1.25px',
      backgroundColor: '#BDBFC3',
      width: '100%',
    };

    return (
      <div style={componentStyle}>
        {menu_titles.map((title: string, index: number) => (
          <div key={title} style={titleContainerStyle}>
            <h3 style={titleStyle}>{title}</h3>
            <div style={lineStyle}></div>
            {sub_menus[title] && sub_menus[title].length > 0 && 
            sub_menus[title].map((subMenu: string, subMenuIndex: number) => {
              // Calculate iconName for each submenu item
          const iconNameExists = sub_menu_icons[title] && sub_menu_icons[title][subMenuIndex];
          const iconName = iconNameExists ? sub_menu_icons[title][subMenuIndex] : '';

              return (
                <div key={subMenu} style={{ marginTop: sub_menu_button_gap, width:'100%'}}>
                  <button
                    onClick={() => this.onSubMenuClicked(subMenu)}
                    onMouseOver={(e) => {
                      const button = e.currentTarget;
                      button.style.backgroundColor = darkenColor(safeSubMenuColor, 20);
                      button.style.filter = 'brightness(80%)';
                    }}
                    onMouseOut={(e) => {
                      const button = e.currentTarget;
                      button.style.backgroundColor = safeSubMenuColor;
                      button.style.filter = 'none';
                    }}
                    style={{ 
                      cursor: "pointer", 
                      width: "100%", 
                      borderRadius: '8px',
                      backgroundColor: sub_menu_color,
                      color: sub_menu_font_color,
                      border: "none",
                      padding: '5px 5px',
                      fontSize: sub_menu_font_size,
                      // Other styles...
                    }}
                  >
                  {/* Conditionally render icon only if iconName exists */}
                  {iconNameExists && (
                    <i className="material-icons" style={{verticalAlign: 'middle', marginRight: '8px'}}>
                      {iconName}
                    </i>
                      )}
                    {subMenu}
                  </button>
                </div>
              );
            })}
          </div>
        ))}
      </div>
    );
  };

  private onSubMenuClicked = (subMenuName: string): void => {
    // Handle sub menu click
    Streamlit.setComponentValue(subMenuName);
  };
}

export default withStreamlitConnection(MultiMenu);
